import React from 'react';
import './App.css';

function Visualizer() {

    return (
      <div className="visualizer">
          <h1>
              This is the Visualizer
          </h1>
          <h2> Second thing in visualizer</h2>
      </div>
    );
  }
  
  export default Visualizer;
